		<head>
			<title> Conway's Game Of Life - Thomas vanBommel</title>
			<link rel='stylesheet' href='https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css' integrity='sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T' crossorigin='anonymous'>
			<style>
				#board{
					padding-top:70px;
					font-family:monospace;
				}

				.game{
					width:max-content;
					height:max-content;

					float:left;
					padding:0px 0 0 0;
					margin:5px;
				}

				.panel{
					line-height:2em;
					margin:10px;
					float:left;
				}

				.pane{
					width:max-content;
					margin:0 auto;
					margin-top:5px;
					line-height:0.6em;
					letter-spacing:1px;
					outline:1px solid white;
					float:left;
				}

				span{
					width:10px;
					height:10px;
					display:block;
					float:left;
					background-color:#ccc;
				}

				span[val='1']{
					background-color:black;
				}

				p{
					margin:0;
					padding:0;
					line-height:1.25em;
				}
			</style>
			<script>
				window.onload = init;

				function init(){
					var panels = document.getElementsByClassName('panel');

					for(var i = 0; i < panels.length; i++){
						var spans = panels[i].getElementsByTagName('span');
						var count = 0;

						for(var j = 0; j < spans.length; j++){
							var val = spans[j].getAttribute('val');

							if(val == 1){
								count++;
							}
						}

						//panels[i].setAttribute('dead', count);

						var div = document.createElement('div');
						//div.append('<p>generation:' + i + '</p>');
						//div.append('<p>count:' + count + '</p>');
						div.innerHTML = '<p>gen: ' + i + '</p><p>count: ' + count + '</p>';
						panels[i].prepend(div);
					}
				}
			</script>
		</head>
